Ben Zion Kon, &quot;University Mathematics Handbook&quot;

English | ISBN: 9655504581 | 2015 | EPUB | 414 pages | 9,4 MB


&quot;By indirections find direction out&quot;-(Shakespeare, Hamlet, Act 2, Scene 1) This handbook is a reference work in which the reader can find definitions and factual information in different fields of mathematics. The purpose of this book is twofold: It is designed for quick reference to mathematical concepts: definitions, rules, formulas and theorems with examples. It can serve as a manual for students for practical applications (homework, exams, etc)
